import React from "react";
import Items from "./Items"

function Forms(){
    return(
        <form class="" action="/delete" method="post">
            <Items task="Read Books"/>
            <input type="hidden" name="listname" value="<%= listTitle %>"></input>
          </form>
    )
}

export default Forms;
